import { TextField } from '@material-ui/core';
import React from 'react';

const Login = () => {
  return (
    <div>
      <form autoComplete="off">
        <TextField id="username" label="Username" />
        <TextField id="password" label="Password" type="password" />
      </form>
    </div>
  );
};

export default Login;
